import Link from 'next/link';
import styled from 'styled-components';

export default function Header() {
  const logo = styled.h1`
    background: red;
  `;
  return (
    <header>
      <div className="bar">
        <Link href="/">
          <logo>Outfits</logo>
        </Link>
      </div>
      <div className="sub-bar">
        <p>Search</p>
      </div>
    </header>
  );
}
